<?php 

$link = "data:image/png;base64,";

$content = file_get_contents($link);

$parse = parse_url($link);

$basename = basename($parse["path"]);
// aqui você pode renomear o nome do arquivo, para não baixar o arquivo da web com os nomes estranhos
$file = fopen($basename, "w+");
// $file = fopen("foto_teste.png", "w+");

fwrite($file, $content);

fclose($file);

?>

<img src="<?= $basename ?>" alt="logo">